import React from "react";
import Grid from "./components/UI/Grid";
import MainCard from "./components/MainCard";
import TimeCards from "./components/TimeCards";
import Attribution from "./components/Attribution";
import TimeframeProvider from "./store/TimeframeProvider";

function App() {
  return (
    <React.Fragment>
      <Grid>
        <TimeframeProvider>
          <MainCard />
          <TimeCards />
        </TimeframeProvider>
      </Grid>
      <Attribution />
    </React.Fragment>
  );
}

export default App;
